import React from 'react';

const ProductCard = () => {
  return (
    <div style={{ border: '1px solid #ccc', padding: '10px', width: '200px' }}>
      <img
        src="https://via.placeholder.com/150"
        alt="product"
        style={{ width: '100%' }}
      />
      <h3>Product Name</h3>
      <p>Price: $10</p>
      <button>Add to Cart</button>
    </div>
  );
};

export default ProductCard;
